              "visualizaQuestao": "<div class=\"adaptive-block-avalicao-visualize\">\n\t\t\n\t\t\n\t\t<div   class=\"ng-binding ng-scope\"><p style=\"text-align:justify;\">A figura a seguir mostra uma tabela periódica simplificada com cinco elementos químicos identificados por I, II, III, IV e V.</p><figure class=\"image image_resized\" style=\"width:365px;\"><img src=\"data:image/png;base64,\" alt=\"Cartão Flashcard • #182045 • Química | olhonavaga\"></figure></div>\n\t\t\n\t\t<div  style=\"padding-bottom: 12px;\" class=\"ng-scope\"></div>\n\t\t\n\t\t<div   class=\"ng-binding ng-scope\"><p style=\"text-align:justify;\">Qual desses elementos apresenta maior estabilidade, ou seja, possui menor tendência a realizar ligação química? Justifique sua resposta.&nbsp;</p><figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\" style=\"border-color:hsl(0, 0%, 0%);border-style:solid;\"><colgroup><col style=\"width:100%;\"></colgroup><tbody><tr><td style=\"border-color:hsl(0, 0%, 0%);border-style:solid;padding:3px;\">&nbsp;</td></tr><tr><td style=\"border-color:hsl(0, 0%, 0%);border-style:solid;padding:3px;\">&nbsp;</td></tr><tr><td style=\"border-color:hsl(0, 0%, 0%);border-style:solid;padding:3px;\">&nbsp;</td></tr></tbody></table></figure></div>\n\t</div>",
