              "visualizaQuestao": "<div class=\"adaptive-block-avalicao-visualize\">\n\t\t\n\t\t\n\t\t<div   class=\"ng-binding ng-scope\"><p style=\"text-align:justify;\">Recentemente, o uso de cigarros eletrônicos tem se popularizado, especialmente entre os jovens. Esses dispositivos frequentemente contêm nicotina, substância altamente viciante que, quando inalada, pode causar diversos prejuízos à saúde, como dependência química e danos ao sistema cardiovascular. A nicotina é um composto orgânico cuja estrutura química é composta por átomos de carbono organizados em diferentes tipos de hibridizações e ligações.</p><figure class=\"image image_resized\" style=\"width:452px;\"><img src=\"data:image/jpeg;base64,\"></figure></div>\n\t\t\n\t\t<div  style=\"padding-bottom: 12px;\" class=\"ng-scope\"></div>\n\t\t\n\t\t<div   class=\"ng-binding ng-scope\"><p style=\"text-align:justify;\">Além da classificação dos átomos de carbono na estrutura da nicotina, outro aspecto importante para entender a química dessa molécula é o tipo de ligação que ela realiza. Sabendo que a nicotina contém átomos de carbono e que suas ligações podem ser do tipo sigma (σ) ou pi (π), responda:</p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\">a) A estrutura da nicotina realiza ligações do tipo pi (π)? Justifique sua resposta apresentando a quantidade de ligações pi que a molécula apresenta.&nbsp;</p><figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:100%;\"></colgroup><tbody><tr><td>&nbsp;</td></tr><tr><td>&nbsp;</td></tr><tr><td>&nbsp;</td></tr></tbody></table></figure></div>\n\t</div>",
