              "visualizaQuestao": "<div class=\"adaptive-block-avalicao-visualize\">\n\t\t\n\t\t\n\t\t<div   class=\"ng-binding ng-scope\"><p style=\"text-align:justify;\">A curcumina, substância encontrada no pó amarelo-alaranjado extraído da raiz da cúrcuma ou açafrão-da-índia (Cúrcuma longa), aparentemente, pode ajudar a combater vários tipos de câncer, o mal de Parkinson e o de Alzheimer e até mesmo retardar o envelhecimento. Usada há quatro milênios por algumas culturas orientais, apenas nos últimos anos passou a ser investigada pela ciência ocidental.</p><figure class=\"image\"><img src=\"data:image/png;base64,\" alt=\"Estrutura química da curcumina | Download Scientific Diagram\"></figure></div>\n\t\t\n\t\t<div  style=\"padding-bottom: 12px;\" class=\"ng-scope\"></div>\n\t\t\n\t\t<div   class=\"ng-binding ng-scope\"><p style=\"text-align:justify;\">Com base na fórmula estrutural fornecida, determine a fórmula molecular deste composto.</p><figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:100%;\"></colgroup><tbody><tr><td>&nbsp;</td></tr><tr><td>&nbsp;</td></tr></tbody></table></figure></div>\n\t</div>",
