                "textoBase": null,
                "comando": null,
                "visualizaQuestao": "{\n  \"fonte\": \"\",\n  \"instrucao\": \"<p style=\\\"margin-left: 0px!important;\\\">Leia atentamente e responda</p>\",\n  \"textoBase\": \"<p style=\\\"margin-left: 0px!important;\\\">A Política Nacional de Resíduos Sólidos (Lei n° 12.305, de 2 de agosto de 2010) define a logística reversa como o “instrumento caracterizado por um conjunto de ações, procedimentos e meios destinados a viabilizar a coleta e a restituição dos resíduos sólidos ao setor empresarial, para reaproveitamento, em seu ciclo ou em outros ciclos produtivos, ou outra destinação final ambientalmente adequada”. A Lei n° 12.305/2010 obriga fabricantes, importadores, distribuidores e comerciantes de agrotóxicos, pilhas, baterias, pneus, óleos lubrificantes, lâmpadas fluorescentes, produtos eletroeletrônicos, embalagens e componentes a estruturar e implementar sistemas de logística reversa, mediante retorno dos produtos após o uso pelo consumidor, de forma independente do serviço público de limpeza urbana e de manejo dos resíduos sólidos.</p>\",\n  \"comando\": \"<p style=\\\"margin-left: 0px!important;\\\">I. O retorno de embalagens e produtos pós-consumo a seus fabricantes e importadores objetiva responsabilizar e envolver, na gestão ambiental, aquele que projeta, fabrica ou comercializa determinado produto e lucra com ele.</p><p style=\\\"margin-left: 0px!important;\\\">II. Fabricantes e importadores responsabilizados, inclusive financeiramente, pelo gerenciamento no pós-consumo são estimulados a projetar, manufaturar e comercializar produtos e embalagens menos poluentes e danosos ao meio ambiente. Fabricantes são os que melhor conhecem o processo de manufatura, sendo, por isso, os mais indicados para gerenciar o reprocessamento e reaproveitamento de produtos e embalagens.</p><p style=\\\"margin-left: 0px!important;\\\">A respeito dessas asserções, assinale a opção correta.</p>\",\n  \"justificarFalsas\": false,\n  \"alternativas\": [\n    \"<p style=\\\"margin-left: 0px!important;\\\">As asserções I e II são proposições verdadeiras, e a II é uma justificativa correta da I.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">As asserções I e II são proposições verdadeiras, mas a II não é uma justificativa correta da I.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">A asserção I é uma proposição verdadeira, e a II é uma proposição falsa.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">A asserção I é uma proposição falsa, e a II é uma proposição verdadeira.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">As asserções I e II são proposições falsas.</p>\"\n  ],\n  \"afirmacoes\": [],\n  \"associacoes\": null,\n  \"assercoes\": null\n}",
