                "visualizaQuestao": "{\n  \"fonte\": \"\",\n  \"referencia\": \"<div class=\\\"referencia-container\\\"><div class=\\\"align-left italic fonte-referencia-width\\\">(todamateria - 2025)</div><span><p style=\\\"margin-left: 0px!important;\\\"><br class=\\\"ProseMirror-trailingBreak\\\"></p><p style=\\\"margin-left: 0px!important;\\\">Texto tabela verdade&nbsp;Texto tabela verdade&nbsp;Texto tabela verdade&nbsp;Texto tabela verdade&nbsp;Texto tabela verdade&nbsp;Texto tabela verdade&nbsp;Texto tabela verdade&nbsp;Texto tabela verdade&nbsp;Texto tabela verdadeTexto tabela verdadeTexto tabela verdadeTexto tabela verdadeTexto tabela verdadeTexto tabela verdade.</p><p style=\\\"margin-left: 0px!important;\\\"><div style=\\\"\\\" class=\\\"ex-image-wrapper ex-image-block-middle tiptap-widget\\\"><img src=\\\"data:image/jpeg;base64,\\\" style=\\\"display: table-cell\\\"></div></p><p style=\\\"margin-left: 0px!important;\\\"><br class=\\\"ProseMirror-trailingBreak\\\"></p></span></div>\",\n  \"instrucao\": \"<p style=\\\"margin-left: 0px!important;\\\">tabela verdade<br></p>\",\n  \"textoBase\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">“Y si llueve, que llueva” es un refrán gallego. Para mí cobró&nbsp;sentido una noche de febrero, cuando vivía en el barrio de la&nbsp;Macarena de Sevilla con dos buenos amigos, gallegos también.&nbsp;Mi compañero y yo nos decidimos a salir ese sábado&nbsp;de noche, pese a que había estado lloviendo algunas&nbsp;horas a lo largo del día. La idea era una locura, al parecer.&nbsp;Le propusimos salir “de parranda” con nosotros a una&nbsp;amiga andaluza, ésta respondió que no, nos dijo que no&nbsp;iba a salir un día de lluvia. Flipamos. Comentamos entre&nbsp;nosotros que si los gallegos no saliésemos de casa cuando&nbsp;llueve, en invierno saldríamos poco. Habríamos inventado&nbsp;el confinamiento hace mucho.&nbsp;Los gallegos no dejamos de salir por la lluvia.</p><p style=\\\"text-align: right; margin-left: 0px!important\\\">Disponível em: https://politicahora.es. Acesso em: 26 out. 2021.</p>\",\n  \"comando\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">O comportamento dos personagens narrado no texto&nbsp;destaca o(a)</p>\",\n  \"justificarFalsas\": false,\n  \"alternativas\": [\n    \"<p style=\\\"margin-left: 0px!important;\\\">A abandono da própria identidade.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">B medo dos perigos durante a noite.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">C influência do grupo na tomada de decisão.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">D diferença cultural entre galegos e andaluzes.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">E variação meteorológica entre Sevilha e Galiza.</p>\"\n  ],\n  \"afirmacoes\": [],\n  \"associacoes\": null,\n  \"assercoes\": null\n}",
