                "textoBase": null,
                "comando": null,
                "visualizaQuestao": "{\n  \"fonte\": \"\",\n  \"instrucao\": \"<p style=\\\"margin-left: 0px!important;\\\"><br></p>\",\n  \"textoBase\": \"<p style=\\\"margin-left: 0px!important;\\\">É fundamentalmente no Minho, norte de Portugal, que o</p><p style=\\\"margin-left: 0px!important;\\\">cavaquinho aparece como instrumento tipicamente popular,</p><p style=\\\"margin-left: 0px!important;\\\">ligado às formas essenciais da música característica dessa</p><p style=\\\"margin-left: 0px!important;\\\">província. O cavaquinho minhoto tem escala rasa com o</p><p style=\\\"margin-left: 0px!important;\\\">tampo, o que facilita a prática do “rasqueado”. O cavaquinho</p><p style=\\\"margin-left: 0px!important;\\\">chega ao Brasil diretamente de Portugal, e o modelo</p><p style=\\\"margin-left: 0px!important;\\\">brasileiro é maior do que a sua versão portuguesa, com</p><p style=\\\"margin-left: 0px!important;\\\">uma caixa de ressonância mais funda. Semelhante ao</p><p style=\\\"margin-left: 0px!important;\\\">cavaquinho minhoto, o machete, ou machetinho madeirense,</p><p style=\\\"margin-left: 0px!important;\\\">é um pequeno cordófono de corda dedilhada, que faz</p><p style=\\\"margin-left: 0px!important;\\\">parte da grande e diversificada família das violas de mão</p><p style=\\\"margin-left: 0px!important;\\\">portuguesas. O ukulele tem a sua origem no século XIX,</p><p style=\\\"margin-left: 0px!important;\\\">tendo como ancestrais o braguinha (ou machete) e o rajão,</p><p style=\\\"margin-left: 0px!important;\\\">instrumentos levados pelos madeirenses quando eles</p><p style=\\\"margin-left: 0px!important;\\\">emigraram para o Havaí.</p><p style=\\\"margin-left: 0px!important;\\\">OLIVEIRA, E. V. Cavaquinhos e família. Disponível em:</p><p style=\\\"margin-left: 0px!important;\\\">https://casadaguitarra.pt. Acesso em: 18 nov. 2021 (adaptado).</p>\",\n  \"comando\": \"<p style=\\\"margin-left: 0px!important;\\\">O conjunto dessas práticas musicais demonstra que os</p><p style=\\\"margin-left: 0px!important;\\\">instrumentos mencionados no texto</p>\",\n  \"justificarFalsas\": false,\n  \"alternativas\": [\n    \"<p style=\\\"margin-left: 0px!important;\\\">A refletem a dependência da utilização de matéria-primaeuropeia.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">B adaptam suas características a cada cultura, assumindonova identidade.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">C comprovam a hegemonia portuguesa na invenção decordófonos dedilhados.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">D ilustram processos de dominação cultural, evidenciandosituações de choque cultural.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">E mantêm nomenclatura própria para garantir a fidelidadeàs formas originais de confecção.</p>\"\n  ],\n  \"afirmacoes\": [],\n  \"associacoes\": null,\n  \"assercoes\": null\n}",
