                "dificuldade": "M",
                "instrucao": null,
                "textoBase": null,
                "comando": null,
                "visualizaQuestao": "{\n  \"fonte\": \"<div class=\\\"align-left italic fonte-questao-width\\\">(Gerada por IA - 2025)</div>\",\n  \"instrucao\": \"<p style=\\\"margin-left: 0px!important;\\\"><br class=\\\"ProseMirror-trailingBreak\\\"></p>\",\n  \"textoBase\": \"<p style=\\\"margin-left: 0px!important;\\\">Algebraic equations are not just abstract mathematical tools; they have practical applications in personal finance.</p>\",\n  \"comando\": \"<p style=\\\"margin-left: 0px!important;\\\">Describe how understanding algebraic equations can help in making informed decisions about budgeting and saving money. Include an example to illustrate your explanation.</p>\",\n  \"justificarFalsas\": false,\n  \"alternativas\": [],\n  \"afirmacoes\": [],\n  \"associacoes\": null,\n  \"assercoes\": null\n}",
                "provaAprovada": true,
                "tipoQuestao": "Discursiva - Argumentativa",
                "dataCriacao": "2025-05-21T16:43:31.849+00:00",
                "ultimaAplicacao": null,
                "fonte": {
                    "codigo": 886,
                    "descricao": "Gerada por IA",
                    "anoFonte": 2025
                },
                "visualizaResposta": "\n      <div style=\"background: #e0dede; border: 0px; padding: 1px 1px;\">\n        <span style=\"font-size: 12px\">\n          <strong>RESPOSTA</strong>\n        </span>\n      </div>\n      <div class=\"coluna-sm-12\">\n        <br>\n        <div><p style=\"margin-left: 0px!important;\">Algebraic equations are instrumental in managing personal finances and making informed decisions about budgeting and saving. By setting up equations, individuals can model their income, expenses, and savings goals to optimize their financial strategies. For example, suppose you earn $2000 per month and want to save 15% of your income while allocating specific amounts for rent ($800), food ($400), and transportation ($200). Let 'x' represent the amount you can spend on other expenses. The equation would be: 2000 = 800 + 400 + 200 + x + (0.15 * 2000). Solving for x, we get x = $300. This means you have $300 left for other expenses, ensuring you meet your savings goal. Using algebra helps in planning and controlling finances effectively.</p></div>\n        <br>\n      </div>\n    ",
