                "visualizaQuestao": "{\n  \"fonte\": \"<div class=\\\"align-left italic fonte-questao-width\\\">(UFMS - 2010 - Adaptação)</div>\",\n  \"instrucao\": \"<p style=\\\"margin-left: 0px!important;\\\"><br></p>\",\n  \"textoBase\": \"<p style=\\\"margin-left: 0px!important;\\\"><br></p>\",\n  \"comando\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">Com relação aos temas evolução e biodiversidade, é correto afirmar que :</p>\",\n  \"justificarFalsas\": false,\n  \"alternativas\": [\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">a floresta Amazônica constitui um exemplo do processo de “especiação geográfica” que resultou na grande diversidade de espécies das florestas tropicais úmidas.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">o banco genético das espécies “empobrece” com as novas adaptações que vão se desenvolvendo para cada ambiente ao longo do tempo, uma vez que as adaptações vão ficando codificadas nos genes das futuras gerações.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">a extinção das espécies não faz parte do processo de evolução.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">os modernos sistemas agrícolas favorecem a amplitude da biodiversidade.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">quando uma população remanescente consegue expandir-se novamente, ela certamente contará com as eventuais mudanças do ambiente</p>\"\n  ],\n  \"afirmacoes\": [],\n  \"associacoes\": null,\n  \"assercoes\": null\n}",
