                "visualizaQuestao": "{\n  \"fonte\": \"<div class=\\\"align-left italic fonte-questao-width\\\">(ENEM - 2024)</div>\",\n  \"instrucao\": \"\",\n  \"textoBase\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">O vírus linfotrópico de células T humanas tipo 1&nbsp;(HTLV-1) é um retrovírus do mesmo grupo do vírus da&nbsp;imunodeficiência humana (HIV). Ambos são transmitidos&nbsp;da mesma forma e infectam as mesmas células de defesa&nbsp;do organismo, os linfócitos T. A diferença entre eles é que o&nbsp;HTLV-1 estimula o aumento da produção desses linfócitos,&nbsp;enquanto o HIV causa destruição dessas células.&nbsp;ROMANELLI, L. C. F.; CARAMELLI, P.; PROIETTI, A. B. F. C. O vírus&nbsp;linfotrópico de células T humanas tipo 1 (HTLV-1): quando&nbsp;suspeitar da infecção? </p><p style=\\\"text-align: right; margin-left: 0px!important\\\">Revista da Associação&nbsp;Médica Brasileira, v. 56, 2010 (adaptado).</p>\",\n  \"comando\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">Uma possível consequência da infecção por HTLV-1 é o&nbsp;desenvolvimento de</p>\",\n  \"justificarFalsas\": false,\n  \"alternativas\": [\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">aids.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">câncer.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">diabetes.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">hepatite B.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">hemorragia.</p>\"\n  ],\n  \"afirmacoes\": [],\n  \"associacoes\": null,\n  \"assercoes\": null\n}",
