                "dificuldade": "D",
                "instrucao": null,
                "textoBase": null,
                "comando": null,
                "visualizaQuestao": "{\n  \"fonte\": \"<div class=\\\"align-left italic fonte-questao-width\\\">(Christus colégio - 2024 - Adaptação)</div>\",\n  \"referencia\": \"\",\n  \"instrucao\": \"<p style=\\\"margin-left: 0px!important;\\\"><br></p>\",\n  \"textoBase\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">As interações entre as bases nitrogenadas do DNA são fundamentais para a manutenção da vida. Normalmente, essas interações ocorrem conforme proposto no modelo de Watson-Crick. Entretanto, existe também o modelo de Hoogsteen. A interação entre as bases adenina (A) e timina (T) para a formação do par A-T para ambos os modelos está representada a seguir:</p><p style=\\\"text-align: justify; margin-left: 0px!important\\\"><br></p><p style=\\\"margin-left: 0px!important;\\\"><br></p><p style=\\\"margin-left: 0px!important;\\\"><br></p><p style=\\\"margin-left: 0px!important;\\\"><br class=\\\"ProseMirror-trailingBreak\\\"></p><p style=\\\"margin-left: 0px!important;\\\"><div style=\\\"width: 617px\\\" class=\\\"ex-image-wrapper ex-image-block-middle tiptap-widget\\\"><img src=\\\"data:image/jpeg;base64,\\\" style=\\\"display: table-cell\\\"></div></p><p style=\\\"margin-left: 0px!important;\\\"><br class=\\\"ProseMirror-trailingBreak\\\"></p><p style=\\\"margin-left: 0px!important;\\\"><br></p><p style=\\\"margin-left: 0px!important;\\\"><br></p><p style=\\\"margin-left: 0px!important;\\\"><br></p><p style=\\\"text-align: justify; margin-left: 0px!important\\\">O mecanismo de funcionamento de alguns fármacos para combate ao câncer, como os agentes alquilantes, depende da inserção de um grupo alquila nas bases de DNA, conforme representado esquematicamente a seguir.</p><p style=\\\"text-align: justify; margin-left: 0px!important\\\"><br></p><p style=\\\"margin-left: 0px!important;\\\"><br></p><p style=\\\"margin-left: 0px!important;\\\"><br></p><p style=\\\"margin-left: 0px!important;\\\"><br class=\\\"ProseMirror-trailingBreak\\\"></p><p style=\\\"margin-left: 0px!important;\\\"><div style=\\\"width: 435px\\\" class=\\\"ex-image-wrapper ex-image-block-middle tiptap-widget\\\"><img src=\\\"data:image/jpeg;base64,\\\" style=\\\"display: table-cell\\\"></div></p><p style=\\\"margin-left: 0px!important;\\\"><br class=\\\"ProseMirror-trailingBreak\\\"></p><p style=\\\"margin-left: 0px!important;\\\"><br></p><p style=\\\"margin-left: 0px!important;\\\"><br></p>\",\n  \"comando\": \"<p style=\\\"margin-left: 0px!important;\\\">De acordo com o modelo de Watson-Crick as interações entre as bases nitrogenadas do DNA ocorrem por&nbsp;</p>\",\n  \"justificarFalsas\": false,\n  \"alternativas\": [\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">ligações de hidrogênio e, na inserção de grupo(s) alquila(s) nessas bases, a adenina consome maior quantidade de agente alquilante, pois possui um maior número de aminas.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">ligações de hidrogênio e, na inserção de grupo(s) alquila(s) nessas bases, a adenina consome maior quantidade de agente alquilante, pois possui um maior número de amidas.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">ligações dipolo-dipolo e, na inserção de grupo(s) alquila(s) nessas bases, a adenina consome maior quantidade de agente alquilante, pois possui um maior número de aminas.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">ligações dipolo-dipolo e, na inserção de grupo(s) alquila(s) nessas bases, a adenina consome maior quantidade de agente alquilante, pois possui um maior número de amidas.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">ligações dipolo induzido e, na inserção de grupo(s) alquila(s) nessas bases, a adenina consome maior quantidade de agente alquilante, pois possui um maior número de amidas secundárias.</p>\"\n  ],\n  \"afirmacoes\": [],\n  \"associacoes\": null,\n  \"assercoes\": null\n}",
