                "visualizaQuestao": "{\n  \"fonte\": \"<div class=\\\"align-left italic fonte-questao-width\\\">(Christus - 2022 - Adaptação)</div>\",\n  \"instrucao\": \"<p style=\\\"margin-left: 0px!important;\\\"><br></p>\",\n  \"textoBase\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">No bloco superior abaixo, são listadas Leis da Termodinâmica; no bloco inferior, frases que caracterizam cada uma dessas leis.</p><p style=\\\"text-align: justify; margin-left: 0px!important\\\">Associe adequadamente o bloco inferior ao superior.</p>\",\n  \"comando\": \"<p style=\\\"margin-left: 0px!important;\\\">A sequência correta de preenchimento dos parênteses, de cima para baixo, é</p>\",\n  \"justificarFalsas\": false,\n  \"alternativas\": [\n    \"<p style=\\\"margin-left: 0px!important;\\\">1 – 2 – 3.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">1 – 3 – 2.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">2 – 1 – 3.</p><p style=\\\"text-align: justify; margin-left: 0px!important\\\"><br></p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">3 – 1 – 2.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">3 – 2 – 1.</p>\"\n  ],\n  \"afirmacoes\": [],\n  \"associacoes\": {\n    \"coluna1\": [\n      {\n        \"descricao\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">1 - Lei Zero da Termodinâmica</p>\",\n        \"item\": \"A)\"\n      },\n      {\n        \"descricao\": \"<p style=\\\"margin-left: 0px!important;\\\">2 - 1ª Lei da Termodinâmica</p>\",\n        \"item\": \"B)\"\n      },\n      {\n        \"descricao\": \"<p style=\\\"margin-left: 0px!important;\\\">3 - 2ª Lei da Termodinâmica</p>\",\n        \"item\": \"C)\"\n      }\n    ],\n    \"coluna2\": [\n      {\n        \"descricao\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">O calor não flui espontaneamente de uma região mais fria para uma região mais quente.</p>\",\n        \"item\": \"(&nbsp;&nbsp;&nbsp;)\"\n      },\n      {\n        \"descricao\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">O calor fornecido a um sistema termodinâmico é consumido na variação da energia interna deste sistema e na realização de trabalho contra forças externas que agem sobre ele.</p>\",\n        \"item\": \"(&nbsp;&nbsp;&nbsp;)\"\n      },\n      {\n        \"descricao\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">Se dois sistemas termodinâmicos estão em equilíbrio térmico com um terceiro, então eles estão em equilíbrio térmico entre si.</p>\",\n        \"item\": \"(&nbsp;&nbsp;&nbsp;)\"\n      }\n    ]\n  },\n  \"assercoes\": null\n}",
