                "visualizaQuestao": "{\n  \"fonte\": \"\",\n  \"instrucao\": \"<p style=\\\"margin-left: 0px!important;\\\"><br></p>\",\n  \"textoBase\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">De acordo com Oliveira e Outros, \\\"a gestão tributária é um ramo da administração responsável pelo gerenciamento dos tributos incidentes nas diversas atividades de uma empresa, (...) de forma a não expor a entidade à possíveis sanções fiscais e legais ou apurar o valor justo do tributo.\\\"</p><p style=\\\"text-align: justify; margin-left: 0px!important\\\">Com base nesta temática, avalie as asserções a seguir e a relação proposta entre elas.</p><p style=\\\"text-align: justify; margin-left: 0px!important\\\"><br></p>\",\n  \"comando\": \"<p style=\\\"margin-left: 0px!important;\\\">A asserção I é uma proposição verdadeira, e a II é uma proposição falsa.</p>\",\n  \"justificarFalsas\": false,\n  \"alternativas\": [\n    \"<p style=\\\"margin-left: 0px!important;\\\">As asserções I e II são proposições verdadeiras, e a II é uma justificativa correta da I.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">As asserções I e II são proposições verdadeiras, mas a II não é uma justificativa correta da I.</p>\",\n    \"<p style=\\\"margin-left: 0px!important;\\\">A asserção I é uma proposição verdadeira, e a II é uma proposição falsa.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">A asserção I é uma proposição falsa, e a II é uma proposição verdadeira.</p>\",\n    \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">As asserções I e II são proposições falsas.</p>\"\n  ],\n  \"afirmacoes\": [],\n  \"associacoes\": null,\n  \"assercoes\": {\n    \"assercao1\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">I.&nbsp;o planejamento tributário constitui um importante instrumento de gestão tributária, sendo válido a sua utilização pelos contribuintes com vistas a reduzir a carga fiscal das empresas, mediante a adoção da alternativa legal menos onerosa</p>\",\n    \"assercao2\": \"<p style=\\\"margin-left: 0px!important;\\\">II.&nbsp;é lícito reduzir carga tributária por meio da evasão fiscal, com o objetivo de ocultar o fato gerador da obrigação tributária.</p>\"\n  }\n}",
