                "visualizaResposta": "\n      <div style=\"background: #e0dede; border: 0px; padding: 1px 1px;\">\n        <span style=\"font-size: 12px\">\n          <strong>RESPOSTA</strong>\n        </span>\n      </div>\n      <div class=\"coluna-sm-12\">\n        <br>\n        <div><p style=\"margin-left: 0px!important;\">O vetor é um inseto hemíptero noturno e hematófago, denominado popularmente como barbeiro ou chupança. O inseto transmite o protoctista por meio de suas fezes liberadas próximas ao local da picada.&nbsp;</p></div>\n        <br>\n      </div>\n    ",
