                "instrucao": null,
                "textoBase": null,
                "comando": null,
                "visualizaQuestao": "{\n  \"fonte\": \"<div class=\\\"align-left italic fonte-questao-width\\\">(Christus - 2022)</div>\",\n  \"instrucao\": \"<p style=\\\"margin-left: 0px!important;\\\"><br class=\\\"ProseMirror-trailingBreak\\\"></p>\",\n  \"textoBase\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">A Tabela Periódica agrega os vários elementos químicos presentes no cotidiano do homem. A configuração eletrônica é o fator primordial para que os elementos químicos sejam agrupados da maneira como estão arranjados na tabela.</p>\",\n  \"comando\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">Com relação à Tabela Periódica atual foram feitas as afirmações a seguir. Escreva (V) quando a afirmação for verdadeira e (F) quando for falsa.<br></p><p style=\\\"margin-left: 0px!important;\\\">( &nbsp; &nbsp;) Na tabela periódica atual, os elementos estão ordenados em ordem crescente de massa atômica.</p><p style=\\\"text-align: justify; margin-left: 0px!important\\\"><br>( &nbsp; &nbsp;) Em um mesmo grupo, os elementos apresentam o mesmo número de camadas.</p><p style=\\\"text-align: justify; margin-left: 0px!important\\\"><br>( &nbsp; &nbsp;) Os elementos do grupo 2 (2A) apresentam, na última camada, a configuração geral ns<sup>2</sup>.<br></p><p style=\\\"text-align: justify; margin-left: 0px!important\\\">( &nbsp; &nbsp;) Um átomo, cuja família é VIIIA ou 18, está classificado na tabela periódica como gás nobre.</p><p style=\\\"text-align: justify; margin-left: 0px!important\\\"><br class=\\\"ProseMirror-trailingBreak\\\"></p>\",\n  \"justificarFalsas\": false,\n  \"alternativas\": [],\n  \"afirmacoes\": [],\n  \"associacoes\": null,\n  \"assercoes\": null\n}",
