                "textoBase": null,
                "comando": null,
                "visualizaQuestao": "{\n  \"fonte\": \"<div class=\\\"align-left italic fonte-questao-width\\\">(Christus - 2022)</div>\",\n  \"instrucao\": \"<p style=\\\"margin-left: 0px!important;\\\">Instrução da questão</p>\",\n  \"textoBase\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">Ao longo da história da química, os cientistas buscaram formas de organizar os elementos químicos para facilitar o estudo e a compreensão de suas propriedades. Uma das primeiras tentativas bem-sucedidas foi a tabela periódica proposta por Dmitri Mendeleev em 1869. No entanto, a tabela periódica moderna que utilizamos hoje apresenta algumas diferenças em relação àquela proposta por Mendeleev.</p>\",\n  \"comando\": \"<p style=\\\"text-align: justify; margin-left: 0px!important\\\">Indique quais foram os principais critérios utilizados por Mendeleev para organizar os elementos em sua tabela periódica e compare com os critérios utilizados na tabela periódica moderna para organizar os elementos.</p><p style=\\\"text-align: justify; margin-left: 0px!important\\\"><br class=\\\"ProseMirror-trailingBreak\\\"></p>\",\n  \"justificarFalsas\": false,\n  \"alternativas\": [],\n  \"afirmacoes\": [],\n  \"associacoes\": null,\n  \"assercoes\": null\n}",
